\" ) ;\nString company2 = prop . getProperty ( \"company2\" ) ;\n\nString company3 = prop . getProperty ( \"company3\" ) ;\n \n\nresult = \"Company List = \" + company1 + \", \" + company2 + \", \" + company3 ;\nSystem . out . println ( result + \"\\nProgram Ran on \" + time + \" by user=\" + user ) ;\n\nreturn result ;\n}\n\n}','<p>how to read property files in java</p>\n<p>http://crunchify.com/java-properties-file-how-to-read-config-properties-values-in-java/\nimport java . io . FileNotFoundException ;</p>\n<p>import java . io . IOException ;\nimport java . io . InputStream ;</p>\n<p>import java . util . Date ;\nimport java . util . Properties ;</p>\n<p> \n//<em>/</em></p>\n<p>/* @author <a href=\"http://Crunchify.com\">Crunchify.com</a>\n/*</p>\n<p>/*/\n </p>\n<p>public class CrunchifyGetPropertyValues {\n </p>\n<p>public String getPropValues ( ) throws IOException {\n </p>\n<p>String result = &quot;&quot; ;\nProperties prop = new Properties ( ) ;</p>\n<p>String propFileName = &quot;config.properties&quot; ;\n </p>\n<p>InputStream inputStream = getClass ( ) . getClassLoader ( ) . getResourceAsStream ( propFileName ) ;\n </p>\n<p>if ( inputStream != null ) {\nprop . load ( inputStream ) ;</p>\n<p>} else {\nthrow new FileNotFoundException ( &quot;property file \'&quot; + propFileName + &quot;\' not found in the classpath&quot; ) ;</p>\n<p>}\n </p>\n<p>Date time = new Date ( System . currentTimeMillis ( ) ) ;\n </p>\n<p>// get the property value and print it out\nString user = prop . getProperty ( &quot;user&quot; ) ;</p>\n<p>String company1 = prop . getProperty ( &quot;company1&quot; ) ;\nString company2 = prop . getProperty ( &quot;company2&quot; ) ;</p>\n<p>String company3 = prop . getProperty ( &quot;company3&quot; ) ;\n </p>\n<p>result = &quot;Company List = &quot; + company1 + &quot;, &quot; + company2 + &quot;, &quot; + company3 ;\nSystem . out . println ( result + &quot;\\nProgram Ran on &quot; + time + &quot; by user=&quot; + user ) ;</p>\n<p>return result 