ar en web.xml \n\n1. quitar restful de la lista de filtros\n\n2. quitar esta parte:\n\n<!-- bootstrap the RestEasy framework -->\n\n<listener>\n\n<listener-class>org.jboss.resteasy.plugins.server.servlet.ResteasyBootstrap</listener-class>\n\n</listener>\n\n<!-- used by RestEasy to determine the JAX-RS resources and other related \n\nconfiguration -->\n\n<context-param>\n\n<param-name>javax.ws.rs.Application</param-name>\n\n<param-value>org.apache.isis.viewer.restfulobjects.server.RestfulObjectsApplication</param-value>\n\n</context-param>\n\n<context-param>\n\n<param-name>resteasy.servlet.mapping.prefix</param-name>\n\n<param-value>/restful/</param-value>\n\n</context-param>\n\n<!-- authenticate user, set up an Isis session -->\n\n<filter>\n\n<filter-name>IsisSessionFilterForRestfulObjects</filter-name>\n\n<filter-class>org.apache.isis.core.webapp.IsisSessionFilter</filter-class>\n\n<!-- authentication required for REST -->\n\n<init-param>\n\n<param-name>authenticationSessionStrategy</param-name>\n\n<param-value>org.apache.isis.viewer.restfulobjects.server.authentication.AuthenticationSessionStrategyBasicAuth</param-value>\n\n</init-param>\n\n<init-param>\n\n<!-- what to do if no session was found; we indicate to issue a 401 basic \n\nauthentication challenge -->\n\n<param-name>whenNoSession</param-name>\n\n<param-value>basicAuthChallenge</param-value>\n\n</init-param>\n\n</filter>\n\n<filter-mapping>\n\n<!-- this is mapped to the entire app; however the IsisSessionFilter will \n\n\"notice\" if the session filter has already been executed for the request \n\npipeline, and if so will do nothing -->\n\n<filter-name>IsisSessionFilterForRestfulObjects</filter-name>\n\n<servlet-name>RestfulObjectsRestEasyDispatcher</servlet-name>\n\n</filter-mapping>\n\n<filter>\n\n<filter-name>IsisTransactionFilterForRestfulObjects</filter-name>\n\n<filter-class>org.apache.isis.viewer.restfulobjects.server.webapp.IsisTransactionFilterForRestfulObjects</filter-class>\n\n</filter>\n\n<filter-mapping>\n\n<filter-name>IsisTransactionFilterForRestfulObjects</filter-name>\n\n<servlet-name>RestfulObjectsRestEasyDispatcher</servlet-name>\n\n</filter-mapping>\n\n<servlet>\n\n<servlet-name>RestfulObjectsRestEasyDispatcher</servlet-name>\n\n<servlet-class>org.jboss.resteasy.plugins.server.servlet.HttpServletDispatcher</servlet-class>\n\n</servlet>\n\n<servlet-mapping>\n\n<servlet-name>RestfulObjectsRestEasyDispatcher</servlet-name>\n\n<url-pattern>/restful//*</url-pattern>\n\n</servlet-mapping>','<p>d2</p>\n<p>modificar en web.xml </p>\n<ol>\n<li>\n<p>quitar restful de la lista de filtros</p>\n</li>\n<li>\n<p>quitar esta parte:</p>\n</li>\n</ol>\n<!-- bootstrap the RestEasy framework -->\n<listener>\n<p><listener-class>org.jboss.resteasy.plugins.server.servlet.ResteasyBootstrap</listener-class></p>\n</listener>\n<!-- used by RestEasy to determine the JAX-RS resources and other related \n\nconfiguration -->\n<context-param>\n<p><param-name>javax.ws.rs.Application</param-name></p>\n<p><param-value>org.apache.isis.viewer.restfulobjects.server.RestfulObjectsApplication</param-value></p>\n</context-param>\n<context-param>\n<p><param-name>resteasy.servlet.mapping.prefix</param-name></p>\n<p><param-value>/restful/</param-value></p>\n</context-param>\n<!-- authenticate user, set up an Isis session -->\n<filter>\n<p><filter-name>IsisSessionFilterForRestfulObjects</filter-name></p>\n<p><filter-class>org.apache.isis.core.webapp.IsisSessionFilter</filter-class></p>\n<!-- authentication required for REST -->\n<init-param>\n<p><param-name>authenticationSessionStrategy</param-name></p>\n<p><param-value>org.apache.isis.viewer.restfulobjects.server.authentication.AuthenticationSessionStrategyBasicAuth</param-value></p>\n</init-param>\n<init-param>\n<!-- what to do if no session was found; we indicate to issue a 401 basic \n\nauthentication challenge -->\n<p><param-name>whenNoSession</param-name></p>\n<p><param-value>basicAuthChallenge</param-value></p>\n</init-param>\n</filter>\n<filter-mapping>\n<!-- this is mapped to the entire app; however the IsisSessionFilter will \n\n\"notice\" if the session filter has already been executed for the request \n\npipeline, and if so will do nothing -->\n<p><filter-name>IsisSessionFilterForRestfulObjects</filter-name></p>\n<p><servlet-name>RestfulObjectsRestEasyDispatcher</servlet-name></p>\n</filter-mapping>\n<filter>\n<p><filter-name>IsisTransactionFilterForRestfulObjects</filter-name></p>\n<p><filter-class>org.apache.isis.viewer.restfulobjects.server.webapp.IsisTransactionFilterForRestfulObjects</filter-class></p>\n</filter>\n<filter-mapping>\n<p><filter-name>IsisTransactionFilterForRestfulObjects</filter-name></p>\n<p><servlet-name>RestfulObjectsRestEasyDispatcher</servlet-name></p>\n</filter-mapping>\n<servlet>\n<p><servlet-name>RestfulObjectsRestEasyDispatcher</servlet-name></p>\n<p><servlet-class>org.jboss.resteasy.plugins.server.servlet.HttpServletDispatcher</servlet-class></p>\n</servlet>\n<servlet-mapping>\n<p><servlet-name>RestfulObjectsRestEasyDispatcher</servlet-name></p>\n<p><url-pattern>/restful//*</url-pattern></p>\n</servlet-mapping>\n'),(1305,991,'ayuda markdown\n[http://stackoverflow.com/editing-help](http://stackoverflow.com/editing-help)','<p>ayuda markdown\n<a href=\"http://stackoverflow.com/editing-help\">http://stackoverflow.com/editing-help</a></p>\n'),(1306,992,'evaluador de webs\n[http://www.woorank.com](http://www.woorank.com)','<p>evaluador de webs\n<a href=\"http://www.woorank.com\">http://www.woorank.com</a></p>\n'),(1307,993,'OPTION SQL_SELECT_LIMIT=100\n\nhttp://bugs.mysql.com/bug.php?id=66659','<p>OPTION SQL_SELECT_LIMIT=100</p>\n<p>http://bugs.mysql.com/bug.php?id=66659</p>\n'),(1308,994,'visa application\napplication id\ns\nsecurity question\nALICE','<p>visa application\napplication id\ns\nsecurity question\nALICE</p>\n'),(1309,995,'* [Open Menu](https://itunes.apple.com/us/album/hunky-dory-2015-remastered/id1039798000#ac-gn-menustate) [Close Menu](https://itunes.