Customer Reviews</h3>\n<h3>A brilliant iconic record.</h3>\n<h3>      by buizel123</h3>\n<p>Highlights include: Life on Mars, Oh You Pretty Things, Andy Warhol, Song For Bob Dylan, and Changes</p>\n<h3>Cha Cha Changes!</h3>\n<h3>      by God Bringer</h3>\n<p>Major Tom we will miss you. This was my favorite David Bowie album. I wore out this album along with his first greatest hits album in the late 70\'s.</p>\n<h3>Biography</h3>\n<p>Genre: Rock\nThe cliché about David Bowie says he\'s a musical chameleon, adapting himself according to fashion and trends. While such a criticism is too glib, there\'s no denying that Bowie demonstrated remarkable skill for perceiving musical trends at his peak in the \'70s. After spending several years in the late \'60s as a mod and as an all-around music hall entertainer, Bowie reinvented himself as a hippie singer/songwriter. Prior to his breakthrough in 1972, he recorded a proto-metal record and a pop/rock album,... <a href=\"https://itunes.apple.com/us/artist/david-bowie/id551695#fullText\">Full Bio</a></p>\n<h3>Top Albums and Songs by David Bowie</h3>\n<p><a href=\"https://itunes.apple.com/us/album/blackstar/id1059043043\"></a></p>\n<p><img src=\"\" alt=\"\" />\n1.</p>\n<ul>\n<li><a href=\"https://itunes.apple.com/us/album/blackstar/id1059043043\">Blackstar</a></li>\n<li><a href=\"https://itunes.apple.com/us/album/hunky-dory-2015-remastered/id1039798000#\">View In iTunes</a></li>\n</ul>\n<p><a href=\"https://itunes.apple.com/us/album/best-of-bowie/id697650603\"></a></p>\n<p><img src=\"\" alt=\"\" />\n2.</p>\n<ul>\n<li><a href=\"https://itunes.apple.com/us/album/best-of-bowie/id697650603\">Best of Bowie</a></li>\n<li><a href=\"https://itunes.apple.com/us/album/hunky-dory-2015-remastered/id1039798000#\">View In iTunes</a>\n<a href=\"https://itunes.apple.com/us/album/rise-fall-ziggy-stardust-spiders/id1039796877\"></a></li>\n</ul>\n<p><img src=\"\" alt=\"\" />\n3.</p>\n<ul>\n<li><a href=\"https://itunes.apple.com/us/album/rise-fall-z