?\nsacar la pagina de equipo de credere</p>\n</li>\n</ul>\n<p>lost in translation\nplaylist dylan</p>\n'),(1344,1030,'ubicación de iCloud Drive en mi disco\n\n/users/miguel/Library/Mobile Documents/com~apple~CloudDocs','<p>ubicación de iCloud Drive en mi disco</p>\n<p>/users/miguel/Library/Mobile Documents/com~apple~CloudDocs</p>\n'),(1345,1031,'imagemagick\n\nhttp://cactuslab.com/imagemagick/','<p>imagemagick</p>\n<p>http://cactuslab.com/imagemagick/</p>\n'),(1346,1032,'bootstrap scrollspy\n[http://getbootstrap.com/javascript//#scrollspy](http://getbootstrap.com/javascript/#scrollspy)','<p>bootstrap scrollspy\n<a href=\"http://getbootstrap.com/javascript/#scrollspy\">http://getbootstrap.com/javascript//#scrollspy</a></p>\n'),(1347,1033,'servidor ftp en mavericks\n\nhttp://igerry.com/desktop/apple-os/enabling-ftp-server-os-x-mavericks.html','<p>servidor ftp en mavericks</p>\n<p>http://igerry.com/desktop/apple-os/enabling-ftp-server-os-x-mavericks.html</p>\n'),(1348,1034,'conversatorio sobre la obligatoriedad\n\n- jefe de proyuecto\n- analista especialista en DE\n\nexplicar las novedades que contiene la regla\ntips para revisar la nota y entenderla\n\nabsolver las inquietudes\ncomo van en la implementación, quedan aprox 40 por homologar de los 239\n\npara el caso de restantes contribuyentes principales, 778 adicionales ya entraron con deadline 1 de julio 2015\nla norma esta dando flexibilidad a este 1er grupo hay empresas que desde hoy van a emitir electrónicamente\n\nla nueva norma incorpora sugerencias de los contribuyentes obligados\nestá sujeta a mejora\n\npuntos cubiertos en la nueva rs 300 sunat:\n- titulo 1: no se está creando un nuevo sistema de emisión electrónica, sino que tenemos dos: uno en el portal sunat y otro el denominado “desde los sistemas del contribuyente”.  uno para los que emiten pocos comprobantes, otro para los que emiten más comprobantes. ahora todos pueden usar ambos sistemas de manera paralela. se ha redefinido a nivel normativo, para que sea un solo sistema con dos alternativas.\n\nel portal no se integra a ningún sistema. no acepta cambios.\ncalidad de emisor electrónico: desde que la sunat lo designe o bien desde que emito 1 factura desde el portal\n\n- titulo 2: desde los sistemas del contribuyente, tiene cambios:\na partir del 1 de abril, la notificación es al buzón electrónico (de la RI), no es por courier\n\nla contingencia la define el emisor. establece la forma en que esa información emitida en contingencia se informa a la sunat. van a tener que informar el detalle de cada documento incluyendo tickets, boletas de venta y facturas. por dia. con el plazo de 7 días. esta opción va  a estar en clave sol y no via web service. desde el 1.4.2015.\nsobre las ND - puede modificar comprobantes físicos, varios comprobantes, puede usarse para penalidades\n\nsobre las NC - puede ajustar documentos autorizados (TUUA x ej) en el campo de referencia, un documento que no es factura o boleta. en el anexo a la norma están los códigos de documentos\n- titulo 3 para ampliar la cantidad de contribuyentes obligados\n\n- titulo 4 sobre el translado de bienes y sobre los emisores itinerantes\n- titulo 5 sobre la ampliación del plazo\n\naparte:\nhay una pagina orientacion.sunat.gob.pe donde hay una serie de informaciones - en sunat.gob.pe hay un link a comprobante de pago electronico\n\nen informacion de interes van a colgar unos programas para validar las tramas que se envian a sunat\npreguntas:\n\na ferreyros le quedan dudas.\n- los ajustes no deben implicar costo adicional por parte del proveedor. se está modificando cosas adicionales en los anexos.\n\n- la sunat tiene una nueva version de los receptores pero no se rechaza las versiones anteriores.\n- la sunat va a publicar una guía de soporte para atención de problemas, se llama a la central de consultas y fuera de horario se envía un correo a una dirección que van a avisar. para otras consultas llamar a la central de consultas.\n\n- a ferreyros de los 8000 clientes solamente le ha contestado 500, a pesar de su campaña. no han visto una campaña de sunat. sunat dice que su campaña ya  empezó pero se le ha cruzado con las elecciones osea que en un par de semanas va a salir en televisión y radio.\n- sunat nos puede pasar afiches y folletos. \n\ngrupo pana tiene quejas sobre la atención del help desk. dice que es un desastre.\nellos lo han implementado después de 6 meses para envío y recepción.  parece que ellos mismos han desarrollado su solución.\n\ndice que no puede enviar 20 documentos porque le sale error de formato y que cuando la sunat le acepta el documento no puede ver el detalle.\nquiere saber si puede enviar facturas desde su servidor de desarrollo al servicio de producción de la sunat para estar seguro que funcione.\n\ndice que no entiende la parte de impresión. todavía tiene que imprimir en papel membreteado con copias? en matricial? con sello? en láser?\nla sunat dice que efectivamente la central de consultas está medio caótica, que se puede enviar correos electrónicos también que va a gente informática.\n\nla sunat le preguntó si ya está homologado y resulta que no. \nsi el servicio rechaza su factura es porque está mal armada.\n\nque lea el xml de retorno del servicio para saber cual es el error.\nque hay una consulta si la factura fue aceptada\n\nla clave tiene una trazabilidad para cada envío de xml\ndice sunat que hay contribuyentes que están enviando 35000 facturas diarias en línea\n\nlima airport tiene 3 consultas\n- sobre las nc que afectan comprobantes tuua: es una pregunta sobre los códigos que hay que usar, parece que hay diferencia entre los catálogos\n\n- el resumen de comprobantes impresos recién se reporta desde el 1 de abril\n- notas de debito por cheque rechazado. le cobran la comisión del banco por cheque sin fondos al cliente. que referencia le pueden dar? hay que asociarlo a la factura por la que se recibió el cheque. que motivo se usa en el catálogo? hay una genérica por \"aumento en el valor\"\n\nnibe import o algo así\ndocumentos que tienen cdr rechazado se deben reportar? deben ser dados de baja? y algo medio enredado sobre \n\ncdr rechazado equivale a comprobante anulado. no se debe incluir en el reporte de bajas.\nen el proceso de homologación tenían 3 respuestas, una es “error con excepción” pero este error no debe haber en producción? \n\nhay 3 motivos de error: 1. errores de excepción (errores propios del sistema, ej. red) en este caso cada código de error tiene su tratamiento, pero en general sunat ni siguiera lo ha podido ver o abrir. no reporta documento 2. rechazo en sunat, por distintos motivos tipo ruc inhabilitado, esta factura ya está reportada y no se puede reemitir. 3. es una factura que se acepta con warning. \notra empresa que no escuché\n\nellos son por elección y no por obligación. tienen una venta retail y venta e-commerce por web - delivery. \npuede seguir imprimiendo comprobantes físicos o tickets mientras no esté obligado. cuando está obligado solamente en contingencia.\n\nsu máquina registradora la tiene que usar por contingencia\nadsur distribuye castrol.\n\ndice que durante su homologación algunas respuestas de la sunat se demoran hasta 8 horas. la sunat dice que esto es por el servicio beta que es para pruebas antes de la homologación. no es en producción.\n su problema está relacionado con traslado de bienes sin una factura aceptada por sunat. la sunat dice que use guías de remisión.\n\nel servicio web está implementado en datapower\nfotomarket\n\ndice que iba a haber una consulta para ver si un ruc está válido, no habido o en baja.\ncuando se haga facturas de papel por contingencia, sigue habiendo una serie por punto de venta? \n\nsobre la consulta: va a existir en clave sol un link para bajar la relación de rucs actualizada diariamente con estados para alimentar nuestros sistemas. en estos días. consulta pública en opciones de clave sol. los seis millones de comprobantes.\nel papel se sigue comportando igual para contingencia (osea con autorización, etc)\n\nde duke energy\nestá hablando de su negocio sobre los decimales de la unidad, porque venden megawatts a 0.00000031 o por el estilo. la sunat permite dos decimales pero ella vende milesimas.\n\nla sunat ya amplió el campo hasta 10 decimales\ndel grupo falabella\n\nemiten notas de credito de un año por devolución. el doc físico no tiene la desagregacion que solicita sunat\nla regla es que el documento se entrega al cliente antes o después de reportar a sunat\n\nalgunos clientes están imprimiendo el documento recién cuando sunat ha generado el cdr y tienes el indicador de aceptado\ntambién hay empresas que están imprimiendo antes de enviar. para que se rechace el documento tiene que haber un error grande, tipo certificado caduco, emisor de baja, estructura fallada (después de haber homologado)\n\nhay una consulta dentro de la clave sol donde se puede consultar los campos tributarios de la factura y el estado (ok, rechazado)\notra opción de consulta por servicio web \n\ncuando es nc por mora / intereses - aumento de valor - y penalidad. las penalidades no se valida la asociacion con factura o boleta, a la sunat le parece que no seria obligatorio en el registro de ventas','<p>conversatorio sobre la obligatoriedad</p>\n<ul>\n<li>jefe de proyuecto</li>\n<li>analista especialista en DE</li>\n</ul>\n<p>explicar las novedades que contiene la regla\ntips para revisar la nota y entenderla</p>\n<p>absolver las inquietudes\ncomo van en la implementación, quedan aprox 40 por homologar de los 239</p>\n<p>para el caso de restantes contribuyentes principales, 778 adicionales ya entraron con deadline 1 de julio 2015\nla norma esta dando flexibilidad a este 1er grupo hay empresas que desde hoy van a emitir electrónicamente</p>\n<p>la nueva norma incorpora sugerencias de los contribuyentes obligados\nestá sujeta a mejora</p>\n<p>puntos cubiertos en la nueva rs 300 sunat:</p>\n<ul>\n<li>titulo 1: no se está creando un nuevo sistema de emisión electrónica, sino que tenemos dos: uno en el portal sunat y otro el denominado “desde los sistemas del contribuyente”.  uno para los que emiten pocos comprobantes, otro para los que emiten más comprobantes. ahora todos pueden usar ambos sistemas de manera paralela. se ha redefinido a nivel normativo, para que sea un solo sistema con dos alternativas.</li>\n</ul>\n<p>el portal no se integra a ningún sistema. no acepta cambios.\ncalidad de emisor electrónico: desde que la sunat lo designe o bien desde que emito 1 factura desde el portal</p>\n<ul>\n<li>titulo 2: desde los sistemas del contribuyente, tiene cambios:\na partir del 1 de abril, la notificación es al buzón electrónico (de la RI), no es por courier</li>\n</ul>\n<p>la contingencia la define el emisor. establece la forma en que esa información emitida en contingencia se informa a la sunat. van a tener que informar el detalle de cada documento incluyendo tickets, boletas de venta y facturas. por dia. con el plazo de 7 días. esta opción va  a estar en clave sol y no via web service. desde el 1.4.2015.\nsobre las ND - puede modificar comprobantes físicos, varios comprobantes, puede usarse para penalidades</p>\n<p>sobre las NC - puede ajustar documentos autorizados (TUUA x ej) en el campo de referencia, un documento que no es factura o boleta. en el anexo a la norma están los códigos de documentos</p>\n<ul>\n<li>\n<p>titulo 3 para ampliar la cantidad de contribuyentes obligados</p>\n</li>\n<li>\n<p>titulo 4 sobre el translado de bienes y sobre los emisores itinerantes</p>\n</li>\n<li>\n<p>titulo 5 sobre la ampliación del plazo</p>\n</li>\n</ul>\n<p>aparte:\nhay una pagina orientacion.sunat.gob.pe donde hay una serie de informaciones - en sunat.gob.pe hay un link a comprobante de pago electronico</p>\n<p>en informacion de interes van a colgar unos programas para validar las tramas que se envian a sunat\npreguntas:</p>\n<p>a ferreyros le quedan dudas.</p>\n<ul>\n<li>\n<p>los ajustes no deben implicar costo adicional por part