r/technetwork/tutorials/obe/java/javamail/javamail.html','<p>sending email java</p>\n<p>http://www.oracle.com/webfolder/technetwork/tutorials/obe/java/javamail/javamail.html</p>\n'),(1350,1036,'[http://clickontyler.com/support/a/38/how-start-apache-automatically/](http://clickontyler.com/support/a/38/how-start-apache-automatically/)\nFor those of you on Mountain Lion and Mavericks using Apple\'s built-in Apache web server, you can set Apache to automatically start when your Mac starts up. Just run the following command in a Terminal window.\nsudo launchctl load -w /System/Library/LaunchDaemons/org.apache.httpd.plist\n\nNote: that command should all be on one line.\n\nTo stop Apache from starting automatically, run this command...\nsudo launchctl unload -w /System/Library/LaunchDaemons/org.apache.httpd.plist','<p><a href=\"http://clickontyler.com/support/a/38/how-start-apache-automatically/\">http://clickontyler.com/support/a/38/how-start-apache-automatically/</a>\nFor those of you on Mountain Lion and Mavericks using Apple\'s built-in Apache web server, you can set Apache to automatically start when your Mac starts up. Just run the following command in a Terminal window.\nsudo launchctl load -w /System/Library/LaunchDaemons/org.apache.httpd.plist</p>\n<p>Note: that command should all be on one line.</p>\n<p>To stop Apache from starting automatically, run this command...\nsudo launchctl unload -w /System/Library/LaunchDaemons/org.apache.httpd.plist</p>\n'),(1351,1037,'Java: How to Encode or Decode URL String Or Form Parameter\n\nhttp://crunchify.com/java-how-to-encode-or-decode-url-string-or-form-parameter/','<p>Java: How to Encode or Decode URL String Or Form Parameter</p>\n<p>http://crunchify.com/java-how-to-encode-or-decode-url-string-or-form-parameter/</p>\n'),(1352,1038,'como crear un query directo en isis\n\n// PersistenceManager pm = jdoSupport.getJdoPersistenceManager();\n\n// Query query = pm.newQuery(ApplicationUser.class, \"this.age >= 18\");','<p>como crear un query directo en isis</p>\n<p>// PersistenceManager pm = jdoSupport.getJdoPersistenceManager();</p>\n<p>// Query query = pm.newQuery(ApplicationUser.class, &quot;this.age &gt;= 18&quot;);</p>\n'),(1353,1039,'[http://stackoverflow.com/questions/26461173/autostart-mysql-server-on-mac-os-x-yosemite](http://stackoverflow.com/questions/26461173/autostart-mysql-server-on-mac-os-x-yosemite)\nThe \n\ncom.mysql.mysql.plist\n in \n\n/Library/LaunchDaemons\n:\n<?xmlversion=\"1.0\"encoding=\"UTF-8\"?><!DOCTYPE plistPUBLIC\"-//Apple//DTD PLIST 1.0//EN\"\"[http://www.apple.com/DTDs/PropertyList-1.0.dtd](http://www.apple.com/DTDs/PropertyList-1.0.dtd)\"]] ><plist version=\"1.0\"]] ><dict]] ><key]] >KeepAlive</key]] ><true/><key]] >Label</key]] ><string]] >com.mysql.mysqld</string]] ><key]] >ProgramArguments</key]] ><array]] ><string>/usr/local/mysql/bin/mysqld_safe</string]] ><string]] >--user=mysql</string></array]] ></dict]] ></plist]] >\n\nAdditionally I\'ve changed the permissions based on [this answer](http://stackoverflow.com/questions/5555589/mysql-5-5-10-mac-10-6-x-auto-start#5557091)\n\nsudo chown root/Library/LaunchDaemons/com.mysql.mysql.plist sudo chgrp wheel/Library/LaunchDaemons/com.mysql.mysql.plist sudo chmod644/Library/LaunchDaemons/com.mysql.mysql.plist\n\nFinally I run this command\n\nsudo launchctlload-w/Library/LaunchDaemons/com.mysql.mysql.plist','<p><a href=\"http://stackoverflow.com/questions/26461173/autostart-mysql-server-on-mac-os-x-yosemite\">http://stackoverflow.com/questions/26461173/autostart-mysql-server-on-mac-os-x-yosemite</a>\nThe </p>\n<p>com.mysql.mysql.plist\n in </p>\n<p>/Library/LaunchDaemons\n:</p>\n<?xmlversion=\"1.0\"encoding=\"UTF-8\"?><!DOCTYPE plistPUBLIC\"-//Apple//DTD PLIST 1.0//EN\"\"[http://www.apple.com/DTDs/PropertyList-1.0.dtd](http://www.apple.com/DTDs/PropertyList-1.0.dtd)\"]] ><plist version=\"1.0\"]] ><dict]] ><key]] >KeepAlive</key]] ><true/><key]] >Label</key]] ><string]] >com.mysql.mysqld</string]] ><key]] >ProgramArguments</key]] ><array]] ><string>/usr/local/mysql/bin/mysqld_safe</string]] ><string]] >--user=mysql</string></array]] ></dict]] ></plist]] >\n<p>Additionally I\'ve changed the permissions based on <a href=\"http://stackoverflow.com/questions/5555589/mysql-5-5-10-mac-10-6-x-auto-start#5557091\">this answer</a></p>\n<p>sudo chown root/Library/LaunchDaemons/com.mysql.mysql.plist sudo chgrp wheel/Library/LaunchDaemons/com.mysql.mysql.plist sudo chmod644/Library/LaunchDaemons/com.mysql.mysql.plist</p>\n<p>Finally I run this command</p>\n<p>sudo launchctlload-w/Library/LaunchDaemons/com.mysql.mysql.plist</p>\n'),(1354,1040,'datos de durand web\n\ndurandab\njJtaC3qngVdkF9\n\ncapecua\nhU3WrtkbPJ2wNE\n\nssh\nkalifornia\n\nGqFXbfW4sW8ZmE','<p>datos de durand web</p>\n<p>durandab\njJtaC3qngVdkF9</p>\n<p>capecua\nhU3WrtkbPJ2wNE</p>\n<p>ssh\nkalifornia</p>\n<p>GqFXbfW4sW8ZmE</p>\n'),(1355,1041,'jufAv4eXjUTpt3xuKmJ','<p>jufAv4eXjUTpt3xuKmJ</p>\n'),(1356,1042,'[http://ptrthomas.wordpress.com/2007/03/02/wicket-impressions-moving-from-spring-mvc-webflow/](http://ptrthomas.wordpress.com/2007/03/02/wicket-impressions-moving-from-spring-mvc-webflow/)\n\n[http://jaxenter.com/tutorial-apache-wicket-the-fun-web-framework-104503.html](http://jaxenter.com/tutorial-apache-wicket-the-fun-web-framework-104503.html)\nwicket in action blog\n\nhttp://wicketinaction.com','<p><a href=\"http://ptrthomas.wordpress.com/2007/03/02/wicket-impressions-moving-from-spring-mvc-webflow/\">http://ptrthomas.wordpress.com/2007/03/02/wicket-impressions-moving-from-spring-mvc-webflow/</a></p>\n<p><a href=\"http://jaxenter.com/tutorial-apache-wicket-the-fun-web-framework-104503.html\">http://jaxenter.com/tutorial-apache-wicket-the-fun-web-framework-104503.html</a>\nwicket in action blog</p>\n<p>http://wicketinaction.com</p>\n'),(1357,1043,'comando de imagemagick para centrar en un canvas blanco una imagen\n\nfind /*.jpg -exec convert {} -gravity center -background white -extent 400x400 -verbose out/{} \\;','<p>