outer es de 512 KB y no los 4MB que tengo contratados.\n\nLa dama que me atendió (omití anotar su nombre) me indicó que se ha cambiado mi servicio por \"facilidades técnicas\" de 4MB a 512KB. Me dijo que esto no se puede revertir y que tengo dos alternativas: presentar un reclamo o llamar al área de atención al cliente a realizar el cambio de servicio contratado.\nLa dama me transfirió al área de Reclamos.\n\nEl Sr. Jaime Marquez me indicó que no procede el cambio de plan de 4MB a 512, ya que en su sistema no está registrado ningún cambio. Me indicó que puede registrar el reclamo pero que no me darà por teléfono el código de reclamo por problemas con el sistema.\nEste reclamo es para:\n\n1. Reclamar por la mala atención telefónica recibida porque una persona me indicó que se cambiado mi plan de 4MB a 512KB sin que sea posible revertirlo y la segunda persona me indicó lo contrario, que no existe ningún cambio de plan.\n2. Reclamar porque no se me entregó el código de reclamo registrado telefónicamente al llamar al 104 (siguiendo el procedimiento especificado por Telefónica)','<p>reclamo telefonica</p>\n<p>reclamo por facturación por velocidad del servicio</p>\n<p>48 horas hábiles </p>\n<p>código de reclamo </p>\n<p>jaime marquez</p>\n<p>area de reclamos de facturación y calidad</p>\n<p>domingo 10 mayo\n12.17 PM</p>\n<p>aparte libro de reclamaciones 12.50:\nLLamé al 104 a reportar un problema con mi servicio Internet, ya que detecté que el ancho de banda recibido en mi router es de 512 KB y no los 4MB que tengo contratados.</p>\n<p>La dama que me atendió (omití anotar su nombre) me indicó que se ha cambiado mi servicio por &quot;facilidades técnicas&quot; de 4MB a 512KB. Me dijo que esto no se puede revertir y que tengo dos alternativas: presentar un reclamo o llamar al área de atención al cliente a realizar el cambio de servicio contratado.\nLa dama me transfirió al área de Reclamos.</p>\n<p>El Sr. Jaime Marquez me indicó que no procede el cambio de plan de 4MB a 512, ya que en su sistema no está registrado ningún cambio. Me indicó que puede registrar el reclamo pero que no me darà por teléfono el código de reclamo por problemas con el sistema.\nEste reclamo es para:</p>\n<ol>\n<li>Reclamar por la mala atención telefónica recibida porque una persona me indicó que se cambiado mi plan de 4MB a 512KB sin que sea posible revertirlo y la segunda persona me indicó lo contrario, que no existe ningún cambio de plan.</li>\n<li>Reclamar porque no se me entregó el código de reclamo registrado telefónicamente al llamar al 104 (siguiendo el procedimiento especificado por Telefónica)</li>\n</ol>\n'),(1374,1060,'Startup a Unix Service using jetty.sh\n\nhttp://www.eclipse.org/jetty/documentation/9.1.2.v20140210/startup-unix-service.html\n\n[https://wiki.eclipse.org/Jetty/Howto/Deploy_Web_Applications/#Deploying_Webapps](https://wiki.eclipse.org/Jetty/Howto/Deploy_Web_Applications#Deploying_Webapps)','<p>Startup a Unix Service using jetty.sh</p>\n<p>http://www.eclipse.org/jetty/documentation/9.1.2.v20140210/startup-unix-service.html</p>\n<p><a href=\"https://wiki.eclipse.org/Jetty/Howto/Deploy_Web_Applications#Deploying_Webapps\">https://wiki.eclipse.org/Jetty/Howto/Deploy_Web_Applications/#Deploying_Webapps</a></p>\n'),(1375,1061,'código de bloqueo 59855','<p>código de bloqueo 59855</p>\n'),(1376,1062,'wicket datatable sortable example\n\nhttp://stackoverflow.com/questions/2726373/how-do-i-display-a-wicket-datatable-sorted-by-a-specific-column-by-default','<p>wicket datatable sortable example</p>\n<p>http://stackoverflow.com/questions/2726373/how-do-i-display-a-wicket-datatable-sorted-by-a-specific-column-by-default</p>\n'),(1377,1063,'error de hibernate y log4j2\n\n[https://github.com/hibernate/hibernate-orm/pull/902](https://github.com/hibernate/hibernate-orm/pull/902)\n[](http://stackoverflow.com/questions/25498048/how-to-disable-hibernate-4-output-with-log4j2) [http://stackoverflow.com/questions/25498048/how-to-disable-hibernate-4-output-w