example.com/ but it won\'t put ?idWebPage=50549 at the end, nor will it put ? at the end.','<p>RewriteRule redirect without the query string</p>\n<p>http://www.electrictoolbox.com/rewrite-rule-redirect-without-query-string/</p>\n<p>The solution</p>\n<p>The solution is ridiculously easy. Simply add the ? after the rewrite rule target like so:</p>\n<p>&lt;virtualhost /*:80&gt;</p>\n<p>    ServerName old.example.com</p>\n<p>    RewriteEngine On</p>\n<p>    RewriteRule ./* http://new.example.com/? [R=301]</p>\n</virtualhost>\n<p>http://old.example.com/afa.asp?idWebPage=50549 will now do a permanent redirect to http://new.example.com/ but it won\'t put ?idWebPage=50549 at the end, nor will it put ? at the end.</p>\n'),(1423,1109,'d1\n\ncrear el proyecto con el arquetipo\n\nimportarlo a eclipse\n\ncambiar la configuracion para mysql:\n\ncambiar en persistor.properties en webapp\n\nisis.persistor.datanucleus.impl.javax.jdo.option.ConnectionDriverName=com.mysql.jdbc.Driver\n\nisis.persistor.datanucleus.impl.javax.jdo.option.ConnectionURL=jdbc:mysql://127.0.0.1/hdet\n\nisis.persistor.datanucleus.impl.javax.jdo.option.ConnectionUserName=root\n\nisis.persistor.datanucleus.impl.javax.jdo.option.ConnectionPassword=root\n\ny cambiar en pom.xml de webapp agregar la dependencia de mysql','<p>d1</p>\n<p>crear el proyecto con el arquetipo</p>\n<p>importarlo a eclipse</p>\n<p>cambiar la configuracion para mysql:</p>\n<p>cambiar en persistor.properties en webapp</p>\n<p>isis.persistor.datanucleus.impl.javax.jdo.option.ConnectionDriverName=com.mysql.jdbc.Driver</p>\n<p>isis.persistor.datanucleus.impl.javax.jdo.option.ConnectionURL=jdbc:mysql://127.0.0.1/hdet</p>\n<p>isis.persistor.datanucleus.impl.javax.jdo.option.ConnectionUserName=root</p>\n<p>isis.persistor.datanucleus.impl.javax.jdo.option.ConnectionPassword=root</p>\n<p>y cambiar en pom.xml de webapp agregar la dependencia de mysql</p>\n'),(1424,1110,'git regresar a una version buena de un archivo\n\ngit log --follow filename\ngit 