add-an-element-to-a-repeatingview-without-refreshing-the-latter\"></a> <a href=\"http://stackoverflow.com/questions/7807514/can-i-add-an-element-to-a-repeatingview-without-refreshing-the-latter\">http://stackoverflow.com/questions/7807514/can-i-add-an-element-to-a-repeatingview-without-refreshing-the-latter</a></p>\n'),(1443,1129,'configuración de jetty en ubuntu\n\nnano /etc/default/grub\nGRUB_GFXMODE=1024x768\n\nupdate-grub2\nsudo reboot\n\nsudo apt-get upgrade\nsudo apt-get update\n\nsudo apt-get -y install mysql-server (pwd=root)\nsudo add-apt-repository ppa:webupd8team/java\n\nsudo apt-get update\nsudo apt-get install oracle-java8-installer\n\n(instalador)\njava -version\n\nsudo apt-get install oracle-java8-set-default\nhttp://download.eclipse.org/jetty/stable-9/dist/\n\nwget http://eclipse.c3sl.ufpr.br/jetty/stable-9/dist/jetty-distribution-9.3.0.v20150612.tar.gz\ntar -xvf jetty-distribution-9.2.5.v20141112.tar.gz\n\nmv jetty-distribution-9.2.5.v20141112 /opt/bin\nsudo ln -s /opt/bin/etty-distribution-9.2.5.v20141112/ jetty\n\nsudo useradd jetty -U -s /bin/false\nsudo chown -R jetty:jetty /opt/jetty\n\ncp /opt/jetty/bin/jetty.sh /etc/init.d/jetty\nnano /etc/default/jetty\n\nJETTY_HOME=/opt/jetty\nJETTY_HOST=0.0.0.0\n\nTMPDIR=/opt/jetty/temp\nJETTY_BASE=/opt/web/mybase\n\ncd /opt/jetty/etc\nnano jetty.conf\n\nañadir jetty-setuid.conf\nftp passive mode\n\nhttp://serverfault.com/questions/450651/500-illegal-port-command-using-command-line-ftp\n/opt/bin/jetty/etc/jetty-setuid.xml :  \n\n<?xml version=\"1.0\"?>\n<!DOCTYPE Configure PUBLIC \"-//Mort Bay Consulting//DTD Configure//EN\" \"http://www.eclipse.org/jetty/configure.dtd\">\n\n<!-- ================================================================ -->\n<!-- Configure the Jetty SetUIDListener                                 -->\n\n<!-- ================================================================ -->\n<Configure id=\"Server\" class=\"org.eclipse.jetty.server.Server\">\n\n  <Call name=\"addLifeCycleListener\">\n    <Arg>\n\n      <New class=\"org.eclipse.jetty.setuid.SetUIDListener\">\n        <Set name=\"startServerAsPrivileged\"><Property name=\"jetty.startServerAsPrivileged\" default=\"false\"/></Set>\n\n        <Set name=\"umaskOctal\"><Property name=\"jetty.umask\" default=\"002\"/></Set>\n        <Set name=\"username\"><Property name=\"jetty.username\" default=\"jetty\"/></Set>\n\n        <Set name=\"groupname\"><Property name=\"jetty.groupname\" default=\"jetty\"/></Set>\n       </New>\n\n    </Arg>\n  </Call>\n\n</Configure>\nmkdir /opt/web/mybase\n\n/opt/web/mybase/start.ini:\n/# ---------------------------------------  \n\n/# Module: deploy\n--module=deploy\n\n/#/# DeployManager configuration\n/# Monitored Directory name (relative to jetty.base)\n\n/# jetty.deploy.monitoredDirName=webapps\n/# ---------------------------------------  \n\n/# Module: server\n--module=server\n\n/#/#\n/#/# Server Threading Configuration\n\n/#/#\n/# minimum number of threads\n\nthreads.min=10\n/# maximum number of threads\n\nthreads.max=200\n/# thread idle timeout in milliseconds\n\nthreads.timeout=60000\n/# buffer size for output\n\njetty.output.buffer.size=32768\n/# request header buffer size\n\njetty.request.header.size=8192\n/# response header buffer size\n\njetty.response.header.size=8192\n/# should jetty send the server version header?\n\njetty.send.server.version=true\n/# should jetty send the date header?\n\njetty.send.date.header=false\n/# What host to listen on (leave commented to listen on all interfaces)\n\n/#jetty.host=myhost.com\n/# Dump the state of the Jetty server, components, and webapps after startup\n\njetty.dump.start=false\n/# Dump the state of the Jetty server, before stop\n\njetty.dump.stop=false\n/# Enable delayed dispatch optimisation\n\njetty.delayDispatchUntilContent=false\n/# ---------------------------------------  \n\n/# Module: http\n--module=http\n\n/#/#/# HTTP Connector Configuration\n/#/# HTTP port to listen on\n\njetty.port=80\n/#/# HTTP idle timeout in milliseconds\n\nhttp.timeout=30000\n/#/# HTTP Socket.soLingerTime in seconds. (-1 to disable)\n\n/# http.soLingerTime=-1\n/#/# Parameters to control the number and priority of acceptors and selectors\n\n/# http.selectors=1\n/# http.acceptors=1\n\n/# http.selectorPriorityDelta=0\n/# http.acceptorPriorityDelta=0\n\n/# ---------------------------------------  \n/# Module: logging\n\n--module=logging\n/#/# Logging Configuration\n\n/# Configure jetty logging for default internal behavior STDERR output\n/# -Dorg.eclipse.jetty.util.log.class=org.eclipse.jetty.util.log.StdErrLog\n\n/# Configure jetty logging for slf4j\n/# -Dorg.eclipse.jetty.util.log.class=org.eclipse.jetty.util.log.Slf4jLog\n\n/# Configure jetty logging for java.util.logging\n/# -Dorg.eclipse.jetty.util.log.class=org.eclipse.jetty.util.log.JavaUtilLog\n\n/# STDERR / STDOUT Logging\n/# Number of days to retain logs\n\n/# jetty.log.retain=90\n/# Directory for logging output\n\n/# Either a path relative to ${jetty.base} or an absolute path\n/# jetty.logs=logs\n\n--module=setuid\n/opt/bin/jetty-http.html\n\njetty.http.port = “80”\nsudo update-rc.d jetty defaults\n\nhttp://www.ubuntugeek.com/install-jetty-9-java-servlet-engine-and-webserver-on-ubuntu-14-10-server.html','<p>configuración de jetty en ubuntu</p>\n<p>nano /etc/default/grub\nGRUB_GFXMODE=1024x768</p>\n<p>update-grub2\nsudo reboot</p>\n<p>sudo apt-get upgrade\nsudo apt-get update</p>\n<p>sudo apt-get -y install mysql-server (pwd=root)\nsudo add-apt-repository ppa:webupd8team/java</p>\n<p>sudo apt-get update\nsudo apt-get install oracle-java8-installer</p>\n<p>(instalador)\njava -version</p>\n<p>sudo apt-get install oracle-java8-set-default\nhttp://download.eclipse.org/jetty/stable-9/dist/</p>\n<p>wget http://eclipse.c3sl.ufpr.br/jetty/stable-9/dist/jetty-distribution-9.3.0.v20150612.tar.gz\ntar -xvf jetty-distribution-9.2.5.v20141112.tar.gz</p>\n<p>mv jetty-distribution-9.2.5.v20141112 /opt/bin\nsudo ln -s /opt/bin/etty-distribution-9.2.5.v20141112/ jetty</p>\n<p>sudo useradd jetty -U -s /bin/false\nsudo chown -R jetty:jetty /opt/jetty</p>\n<p>cp /opt/jetty/bin/jetty.sh /etc/init.d/jetty\nnano /etc/default/jetty</p>\n<p>JETTY_HOME=/opt/jetty\nJETTY_HOST=0.0.0.0</p>\n<p>TMPDIR=/opt/jetty/temp\nJETTY_BASE=/opt/web/mybase</p>\n<p>cd /opt/jetty/etc\nnano jetty.conf</p>\n<p>añadir jetty-setuid.conf\nftp passive mode</p>\n<p>http://serverfault.com/questions/450651/500-illegal-port-command-using-command-line-ftp\n/opt/bin/jetty/etc/jetty-setuid.xml :  </p>\n<?xml version=\"1.0\"?>\n<!DOCTYPE Configure PUBLIC \"-//Mort Bay Consulting//DTD Configure//EN\" \"http://www.eclipse.org/jetty/configure.dtd\">\n<!-- ================================================================ -->\n<!-- Configure the Jetty SetUIDListener                                 -->\n<!-- ================================================================ -->\n<Configure id=\"Server\" class=\"org.eclipse.jetty.server.Server\">\n<p>  <Call name=\"addLifeCycleListener\">\n    <Arg></p>\n<p>      <New class=\"org.eclipse.jetty.setuid.SetUIDListener\">\n        <Set name=\"startServerAsPrivileged\"><Property name=\"jetty.startServerAsPrivileged\" default=\"false\"/></Set></p>\n<p>        <Set name=\"umaskOctal\"><Property name=\"jetty.umask\" default=\"002\"/></Set>\n        <Set name=\"username\"><Property name=\"jetty.username\" default=\"jetty\"/></Set></p>\n<p>        <Set name=\"groupname\"><Property name=\"jetty.groupname\" default=\"jetty\"/></Set>\n       </New></p>\n<p>    </Arg>\n  </Call></p>\n</Configure>\nmkdir /opt/web/mybase\n<p>/opt/web/mybase/start.ini:\n/# ---------------------------------------  </p>\n<p>/# Module: deploy\n--module=deploy</p>\n<p>/#/# DeployManager configuration\n/# Monitored Directory name (relative to jetty.base)</p>\n<p>/# jetty.deploy.monitoredDirName=webapps\n/# ---------------------------------------  </p>\n<p>/# Module: server\n--module=server</p>\n<p>/#/#\n/#/# Server Threading Configuration</p>\n<p>/#/#\n/# minimum number of threads</p>\n<p>threads.min=10\n/# maximum number of threads</p>\n<p>threads.max=200\n/# thread idle timeout in milliseconds</p>\n<p>threads.timeout=60000\n/# buffer size for output</p>\n<p>jetty.output.buffer.size=32768\n/# request header buffer size</p>\n<p>jetty.request.header.size=8192\n/# response header buffer size</p>\n<p>jetty.response.header.size=8192\n/# should jetty send the server version header?</p>\n<p>jetty.send.server.version=true\n/# should jetty send the date header?</p>\n<p>jetty.send.date.header=false\n/# What host to listen on (leave commented to listen on all interfaces)</p>\n<p>/#jetty.host=myhost.com\n/# Dump the state of the Jetty server, components, and webapps after startup</p>\n<p>jetty.dump.start=false\n/# Dump the state of the Jetty server, before stop</p>\n<p>jetty.dump.stop=false\n/# Enable delayed dispatch optimisation</p>\n<p>jetty.delayDispatchUntilContent=false\n/# ---------------------------------------  </p>\n<p>/# Module: http\n--module=http</p>\n<p>/#/#/# HTTP Connector Configuration\n/#/# HTTP port to listen on</p>\n<p>jetty.port=80\n/#/# HTTP idle timeout in milliseconds</p>\n<p>http.timeout=30000\n/#/# HTTP Socket.soLingerTime in seconds. (-1 to disable)</p>\n<p>/# http.soLingerTime=-1\n/#/# Parameters to control the number and priority of acceptors and selectors</p>\n<p>/# http.selectors=1\n/# http.acceptors=1</p>\n<p>/# http.selectorPriorityDelta=0\n/# http.acceptorPriorityDelta=0</p>\n<p>/# ---------------------------------------  \n/# Module: logging</p>\n<p>--module=logging\n/#/# Logging Configuration</p>\n<p>/# Configure jetty logging for default internal behavior STDERR output\n/# -Dorg.eclipse.jetty.util.log.class=org.eclipse.jetty.util.log.StdErrLog</p>\n<p>/# Configure jetty logging for slf4j\n/# -Dorg.eclipse.jetty.util.log.class=org.eclipse.jetty.util.log.Slf4jLog</p>\n<p>/# Configure jetty logging for java.util.logging\n/# -Dorg.eclipse.jetty.util.log.class=org.eclipse.jetty.util.log.JavaUtilLog</p>\n<p>/# STDERR / STDOUT Logging\n/# Number of days to retain logs</p>\n<p>/# jetty.log.retain=90\n/# Directory for logging output</p>\n<p>/# Either a path relative to ${jetty.base} or an absolute path\n/# jetty.logs=logs</p>\n<p>--module=setuid\n/opt/bin/jetty-http.html</p>\n<p>jetty.http.port = “80”\nsudo update-rc.d jetty defaults</p>\n<p>http://www.ubuntugeek.com/install-jetty-9-java-servlet-engine-and-webserver-on-ubuntu-14-10-server.html</p>\n'),(1444,1130,'en isis para abrir el documento en edit mode\n\nen 1.6 no se podía, había que hacer esto\n\nhttp://isis.markmail.org/search/?q=untitled/#query:untitled+page:1+mid:ich3q577bbh6bpby+state:results','<p>en isis para abrir el documento en edit mode</p>\n<p>en 1.6 no se podía, había que hacer esto</p>\n<p>http://isis.markmail.org/search/?q=untitled/#query:untitled+page:1+mid:ich3q577bbh6bpby+state:results</p>\n'),(1445,1131,'ejercicio tinnitus\nhacer con audífonos\nprograma whiteslip para ruido blanco\nterapia para fonofobia\npieza musical que te guste que tenga 20 minutos de duración y rango dinámico pequeño\nte pones tus audífonos y vas a ir subiendo el volumen por poquitos y cuando notas que te molesta el volumen bajas un poco el volumen hasta que te deje de molestar\nde allí subes un poquitín para que sientas el incremento y ese es tu volumen de referencia\nde allí escuchas un rato en ese volumen y cuando ya te sientes comido y allí haces un incremento hasta que hagas unos cuatro o cinco incrementos\ntodos los días 20 minutos o media hora','<p>ejercicio tinnitus\nhacer con audífonos\nprograma whiteslip para ruido blanco\nterapia para fonofobia\npieza musical que te guste que tenga 20 minutos de duración y rango dinámico pequeño\nte pones tus audífonos y vas a ir subiendo el volumen por poquitos y cuando notas que te molesta el volumen bajas un poco el volumen hasta que te deje de molestar\nde allí subes un poquitín para que sientas el incremento y ese es tu volumen de referencia\nde allí escuchas un rat