ackoverflow.com/questions/8364721/removing-part-of-a-filename-with-mv)','<p>comando para eliminar .png.jpg cuando uso convert para convertir archivos </p>\n<p>for file in /*.png.jpg ; do mv &quot;$file&quot; &quot;${file%.png.jpg}.jpg&quot; ; done\n<a href=\"http://stackoverflow.com/questions/8364721/removing-part-of-a-filename-with-mv\"></a> <a href=\"http://stackoverflow.com/questions/8364721/removing-part-of-a-filename-with-mv\">http://stackoverflow.com/questions/8364721/removing-part-of-a-filename-with-mv</a></p>\n'),(1457,1143,'semalt fase 3\n[fjaudio.com](http://fjaudio.com)\n\nvacideerdazimic.pe','<p>semalt fase 3\n<a href=\"http://fjaudio.com\">fjaudio.com</a></p>\n<p>vacideerdazimic.pe</p>\n'),(1458,1144,'poner solo categoría con la linea y el fabric\nañadir el fabric al producto\nun grid de productos y las categorias a la izquierda\ny la cosa para ver fotos dentro de la pagina de producto junto a la descripcion\nwaddler clothing\ncorregir el spacing del parrafo de historia\nque el texto sea un poquito más claro\ncambiar el naranja de las figuras a que sea mas pacifico\n[http://www.jacklmoore.com/zoom/](http://www.jacklmoore.com/zoom/)','<p>poner solo categoría con la linea y el fabric\nañadir el fabric al producto\nun grid de productos y las categorias a la izquierda\ny la cosa para ver fotos dentro de la pagina de producto junto a la descripcion\nwaddler clothing\ncorregir el spacing del parrafo de historia\nque el texto sea un poquito más claro\ncambiar el naranja de las figuras a que sea mas pacifico\n<a href=\"http://www.jacklmoore.com/zoom/\">http://www.jacklmoore.com/zoom/</a></p>\n'),(1459,1145,'[http://www.getsymphony.com/discuss/thread/31740/](http://www.getsymphony.com/discuss/thread/31740/)\n\nsobre el mysql:\n[http://stevethomas.com.au/notes/notes-for-installing-symphony-cms-on-ubuntu.html](http://stevethomas.com.au/notes/notes-for-installing-symphony-cms-on-ubuntu.html)','<p><a href=\"http://www.getsymphony.com/discuss/thread/31740/\">http://www.getsymphony.com/discuss/thread/31740/</a></p>\n<p>sobre el mysql:\n<a href=\"http://stevethomas.com.au/notes/notes-for-installing-symphony-cms-on-ubuntu.html\">http://stevethomas.com.au/notes/notes-for-installing-symphony-cms-on-ubuntu.html</a></p>\n'),(1460,1146,'lazy loading / paging \n\nhttp://www.icesoft.org/JForum/posts/list/8549.page\n\nIn essence you simply create a new class (LazyLoading.java for example) and make it extend java.util.AbstractList. What you do then is simply \"lie\" how big the list is because the ice:dataPaginator uses the size() method in the list to find out the entries count. Then you implement your own get(int index) method which loads data as they become needed (when you flip the page). A link to the page with the second method (the elegant and simple one) can be found here! - \n\nSee more at: http://www.icesoft.org/JForum/posts/list/8549.page/#sthash.8lCvhNjL.dpuf','<p>lazy loading / paging </p>\n<p>http://www.icesoft.org/JForum/posts/list/8549.page</p>\n<p>In essence you simply create a new class (LazyLoading.java for example) and make it extend java.util.AbstractList. What you do then is simply &quot;lie&quot; how big the list is because the ice:dataPaginator uses the size() method in the list to find out the entries count. Then you implement your own get(int index) method which loads data as they become needed (when you flip the page). A link to the page with the second method (the elegant and simple one) can be found here! - </p>\n<p>See more at: http://www.icesoft.org/JForum/posts/list/8549.page/#sthash.8lCvhNjL.dpuf</p>\n'),(1461,1147,'como encontrar el component path a la hora de hacer tests en wicket\n\nhttp://stackoverflow.com/questions/13565130/how-to-find-out-component-path','<p>como encontrar el component path a la hora de hacer tests en wicket</p>\n<p>http://stackoverflow.com/questions/13565130/how-to-find-out-component-path</p>\n'),(1462,1148,'http://javarevisited.blogspot.sg/2014/05/10-articles-every-programmer-must-r